import SharedContext from './SharedContext';
import {AppBar} from '@mui/material';
/**
 * @return {object} JSX
 */
function TopBar() {
  return (
    <SharedContext.Consumer>
      {({mailbox}) => (
        <AppBar position='fixed' sx={{zIndex:
          (theme) => theme.zIndex.drawer + 1}}>
          <div>CSE186 Mail -{mailbox}</div>
        </AppBar>
      )}
    </SharedContext.Consumer>
  );
}

export default TopBar;
